	/**
		Переводит массив вида:
		Array
		(
		    [0] => Array
		        (
		            [name] => 110_1.jpg
		        )
		
		    [1] => Array
		        (
		            [name] => 110_2.png
		        )
		        
		В массив вида:
		)
		Array
		(
		    [0] => 110_1.jpg
		    [1] => 110_2.png
		)
	 */
	function arrayLevelUp($array)
	{
		return array_map(function($a) {  return array_pop($a); }, $array);
	}
	
	
